import React from 'react';

const EllaBrandIcon = ({ className, width = 30, height = 16 }) => (
  <svg 
    className={`ella-brand-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 30 16"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <text x="0" y="12" fill="currentColor" fontSize="12" fontFamily="system-ui, sans-serif" fontWeight="600">
      Ella
    </text>
  </svg>
);

export default EllaBrandIcon;
